      checked: true,
    },
    {
      id: 2,
      text: '남혁',
      checked: true,
    },
    {
      id: 3,
      text: '정회륜',
      checked: false,
    },
  ]);

  return (
      <div1 className={styles.boxe}>
        <div className={styles.leftb}>
          진료 희망자
        </div>
        <div className={styles.rightb}>
          사람 목록
          <ButtonGroup
            orientation="vertical"
           aria-label="vertical contained button group"
            variant="text"
            >
        {buttons}
      </ButtonGroup>
        </div>
      </div1>
  );
}

export default R1;
